snippet.description:
I can finally sleep
Try Hostinger Server Hosting today! http://hostinger.com/danielkrafft

More Redesigns: https://youtube.com/playlist?list=PLSh10HLKI-DjA3Rbn8puAh-_sUwA8Gq0x

MOD DOWNLOAD: (Must be active for a bit) 
➤ Discord - https://discord.gg/daniel-krafft-s-blender-cult-696502615034429501

Credits:
Daniel Krafft
Kayden Editor (Editing)
Matthew Giles (Editing)
@SkylorBeck  (Modding)
@AntVenom  (Reacting)
@YUNGNICKYOUNG  (Reacting)
@mim1q  (Reacting)
@ImTerasHD  (Reacting)

Follow please
➤ Instagram - https://www.instagram.com/danielkkrafft/
➤ Twitter - https://twitter.com/danielkkrafft

Alright so in this video I straight up just made one of the most advanced Minecraft dungeon systems ever. My viewers have been asking me to make a Minecraft mod, and this is basically a system that I can easily add more bosses/weapons to in the future. I apologize if the video was too technical/low editing, I have not made a video this long in a looong time. I underestimated how much work goes into the "polishing" phase of a project like this lol. I had a few pro Minecraft modders react to my work, and they all thought it had high potential, but held back by random bugs/balance problems. Overall, I'm kinda disappointed that I couldn't make more in the time frame, but the process itself was very valuable and I learned a lot. Somehow, minecraft modding manages to be significantly harder than actually making a game from scratch in godot. Hopefully I can redeem the project over time, but for now, thanks for watching

//about
My name's daniel and I design things. Usually I do 3d modeling in blender but I'm now a metal worker thanks to mr beast apparently??? Who knows what I'll design in the future. If you have any ideas please let me know

